window.bookSummaryJSON = "<p>What lies beyond Blackmoor Cove and its connected Tower?&nbsp;</p> <p>When two displaced Heroes from the recently fallen Town of Emberstone seek refuge from the advancing corruption, some people begin to believe that Jack’s brazen defiance of traditional ways has terrible consequences.</p> <p>New Buildings, new Townsfolk, and new Heroes bring new opportunities for everyone, and as Jack continues pushing them forward, the virtual entities around him begin to explore the limits of Subroutine Sana.&nbsp;</p> <p>This “Crunchy” GameLIT/LitRPG story contains: Item-Based character growth, empire building, unique monsters, bizarre boss fights, and the abuse of game mechanics.</p>"; 
